import React from 'react';
import { GoogleMap, LoadScript } from '@react-google-maps/api';
import Menubar from '../sections/Menubar.js';

const containerStyle = {
  width: '400px',
  height: '400px'
};

const center = {
  lat: -34.397,
  lng: 150.644
};

const MapComponent = ({ title }) => {
  return (
    <div>
        <Menubar />
      <h2>{title}</h2>
      <LoadScript
        googleMapsApiKey="AIzaSyChSvk8z0j12Y0wxtUe3gFPRiCTKqBrYtI"
      >
        <GoogleMap
          mapContainerStyle={containerStyle}
          center={center}
          zoom={10}
        >
          {/* Additional Map components like markers can be added here */}
        </GoogleMap>
      </LoadScript>
    </div>
  );
};

export default MapComponent;
